INSERT INTO `documents_editables` VALUES (38, 'academy_about_text1', 'input', 'Founded in 2003, IP Academy has established itself as a center of excellence in IP/IA education and training in Singapore and the region. Showcasing a multilingual faculty from both academia and industry, our range of executive training and certification programmes aim to build skills and expertise in the fields of intellectual property law, IP/IA management and value creation');
INSERT INTO `documents_editables` VALUES (38, 'academy_about_text2', 'input', 'IP Academy has also built a global network of partnerships with institutes of higher learning and professional associations to augment our programmes, seminars and roundtables.  Our students and institutional clients are from all over the world, facilitating the sharing of best practices and knowledge. Whether you are a business or public agency looking to build capabilities in IP/IA management, or an individual seeking a career in this exciting area of IP/IA, we have will have a suitable programme for your specific needs.');
INSERT INTO `documents_editables` VALUES (38, 'academy_about_title', 'input', 'IP Academy is the education and training arm of IPOS International, and Singapore’s only dedicated centre for intellectual property education and training. We help enterprises and industries leverage their intellectual property (IP) and intangible assets (IA) for growth.');
