INSERT INTO `object_localized_data_4` VALUES (45, 'en', 'IP Expert Series Webinar – Achieving MAD Growth with Intangible Assets', 'Ye Thu Aung,IP Strategist', '<p style=\"margin-left:0; margin-right:0; text-align:start\">Building strategies around a business idea, product or service is something all entrepreneurs and business owners are good at. Knowing how to fit intellectual property (IP) and intangible assets (IA) into these strategies to grow may not come as easily. How does one build a strong growth strategy with IP and IA? Why does it matter?</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Get your answers with this IP Expert Series - Achieving MAD Growth with Intangible Assets webinar where Senior IP Strategist, Fu Zhikang shares:</p>\n\n<div class=\"list-style-general margin\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">\n<ol>\n	<li>Why intangible assets are valuable to businesses.</li>\n	<li>How to Identify key intangible assets with the M.A.D. Growth framework in 30 mins.</li>\n	<li>How to increase business impact with good intangible assets management.</li>\n</ol>\n</div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">This webinar is held in association with&nbsp;IP Week @ SG 2021.</p>\n');
INSERT INTO `object_localized_data_4` VALUES (45, 'zh', NULL, NULL, NULL);
INSERT INTO `object_localized_data_4` VALUES (46, 'en', 'Episode 7: Making Money From Your IP (Da Vinci)', 'zhangsan', '<p style=\"margin-left:0; margin-right:0; text-align:start\">Entrepreneurs – the heroes of our new economy1. As an IP Strategist, I have had the good fortune to interact with many startup founders in my work. Like heroes in the comic and cinematic universe, a startup founder is perennially faced with a multitude of pressing challenges, such as validating the company’s problem statement, building an A-team and seeking funding to get through `the next six months’. As a result, many founders neglect the management of their intangible assets, which are keys to the company’s unique selling proposition and sustainable value creation. Talking about intangible assets to startup founders usually earns me a puzzled look. Based on these conversations, I would like to share some common questions that startup founders have about intangible assets.</p>\n\n<p style=\"margin-left:0; margin-right:0\"><a href=\"http://192.168.29.95:8080/en/Resources/Articles\" style=\"box-sizing: border-box; outline: none; background-color: rgb(255, 255, 255); color: rgb(255, 255, 255); text-decoration: none; font-family: Poppins, sans-serif; font-weight: 400; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\" tabindex=\"-1\">Read also: How Effective IP Management Can Help Your SME</a></p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">What are intangible assets and why are they important?</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The textbook definition of intangible assets is assets that are not physical in nature. These include registrable intellectual property and non-registrable assets, such as those in the table below. These assets are the ingredients for a company’s secret sauce, and every company will have its own recipe.</p>\n\n<div class=\"illustration-view\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; height:0px; letter-spacing:normal; margin-bottom:32px; orphans:2; outline:none; padding-top:468.646px; position:relative; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; width:751.333px; word-spacing:0px\"><a href=\"/images/resources/u=1569546883,489283881&fm=26&fmt=auto&gp=0.jpg\" pimcore_id=\"188\" pimcore_type=\"asset\" tabindex=\"-1\"><img class=\"illustration-img\" src=\"http://192.168.29.95:8080/static/images/articles%20intangible%20assets%20101%20for%20startups2.eee6fde.jpg\" style=\"border-radius:24px; border-style:none; box-sizing:border-box; height:468.646px; left:0px; object-fit:cover; outline:none; position:absolute; top:0px; vertical-align:middle; width:751.333px\" /></a></div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The importance of intangible assets can be stated simply; they represent the bulk of the value in a startup. To illustrate this, consider a startup that has received seed funding at a valuation of $1M. This valuation would not be based solely on the startup’s physical assets but derived in bulk from the expectation of future value. In turn, the key to unlocking this future value would be the startup’s painstakingly developed secret sauce, which it should jealously guard. This is done by protecting the portfolio of intangible assets which make up the secret sauce, an important element and first step in its overall IP strategy and commercialisation.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Dive into our complimentary business guides for more in-depth tips on IP management, commercialisation and more</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">As a young startup, do I really have such intangible assets?</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Most startups possess a larger portfolio of intangible assets than they realise. Let’s take the example of a telehealth startup which offers an online platform providing users with access to a panel of medical practitioners for simple and fuss-free consultations (illustrated below).</p>\n\n<div class=\"illustration-view\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; height:0px; letter-spacing:normal; margin-bottom:32px; orphans:2; outline:none; padding-top:468.646px; position:relative; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; width:751.333px; word-spacing:0px\"><img class=\"illustration-img\" src=\"http://192.168.29.95:8080/static/images/articles%20intangible%20assets%20101%20for%20startups3.548ee1a.jpg\" style=\"border-radius:24px; border-style:none; box-sizing:border-box; height:468.646px; left:0px; object-fit:cover; outline:none; position:absolute; top:0px; vertical-align:middle; width:751.333px\" /></div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Such a startup will have:</p>\n\n<ul style=\"margin-left:0; margin-right:0\">\n	<li>Software code for its online and/or mobile platform, which is automatically protected by copyright and can be protected as a trade secret by implementing additional safeguards.</li>\n	<li>Proprietary data from collection of user data, preferences and activity, which can be used to improve its product features or monetised in adjacent industries.</li>\n	<li>Brand of the startup which creates long-term value for the company.</li>\n	<li>Know-how in the heads of key employees who formulate the algorithms and design the user experience of the platform.</li>\n	<li>Key relationships such as those with key opinion leaders who can influence medical practitioners to join the platform.</li>\n	<li>These are just a few examples. Startups in the hardware space will likely possess an even larger portfolio of intangible assets, such as patents and registered designs, to protect the functional and aesthetic design of its product.</li>\n</ul>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Not sure if your business has intangible assets that need to be protected? Check out our complimentary business guide - Safeguarding Your Competitive Advantage</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Is it really that important to manage these intangible assets now? I have other priorities!</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">As a busy entrepreneur, the management of intangible assets may not appear to be a pressing need. This is because the repercussions of not managing the startup’s intangible assets well are unlikely to be immediate. Instead, the repercussions manifest after the startup has achieved some success. Consider the following scenarios using the same telehealth example:</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Software code</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">When conducting due diligence on the startup in preparation for a Series C round, the VC discovers that the telehealth platform was built on copyleft software, and the startup is obliged to publish its software for free. This causes the valuation of the company to plunge (see Artifex v. Hancom).</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Brand</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The startup has achieved moderate success in Singapore and gained some brand recognition. The next step of the startup’s growth is to expand overseas. In preparation for this, the company applies to register its logo in its markets of interest, only to realise that the logo has already been registered by a third party. The startup is forced to acquire the logo from this third party for a fee (see Apple v. Proview) or spend an inordinate amount to rebrand itself in the new market, thus losing the brand equity it could have leveraged.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Trade secret</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">A key employee leaves for a competitor and implements a core algorithm from the startup in the competitor’s platform, greatly eroding the company’s competitive advantage (see Uber v. Waymo).</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">These scenarios can derail your startup at a stage when it is supposed to be scaling up. However, they can be avoided by managing your intangible assets early. In addition, having a good grasp of your intangible assets — the ingredients of your secret sauce will allow you to articulate the value of your startup to investors clearly and lessen the pain of the due diligence process.</p>\n\n<p style=\"margin-left:0; margin-right:0\"><a href=\"http://192.168.29.95:8080/en/Resources/Articles\" style=\"box-sizing: border-box; outline: none; background-color: rgb(255, 255, 255); color: rgb(255, 255, 255); text-decoration: none; font-family: Poppins, sans-serif; font-weight: 400; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\" tabindex=\"-1\">Read also: Reimagine Your Business with IP</a></p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">I’m convinced that I should start managing my intangible assets early, but have heard that IP protection is really expensive?</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">A good intangible asset management framework will take into account your business model, budget considerations and protection needs. Not all intangible assets can, or should be, protected by obtaining formal registration (e.g., patent, trade mark and registered design protection). Some intangible assets are better protected in the form of trade secrets, which do not entail any registration fees but a stringent policy. The perception of the high cost of protection for intangible assets mainly stems from high patenting costs (that said, there are ways to delay the cost of patent protection). Trade mark and registered design registration fees are actually quite moderately priced. By considering all options of intangible asset protection holistically, startups should be able to arrive at a protection strategy that fits within their budget.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Begin today</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">I hope that the answers to the questions on intangible assets above have helped resolve some of your own. As a startup founder, your intangible assets are what power your company. Do not let the neglect of these assets take the magic off your unicorn prematurely. Start identifying and managing your most important assets today.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">[1] https://www.straitstimes.com/business/a-new-singaporean-hero-must-be-the-entrepreneur-ong-ye-kung</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">IPOS International helps enterprises and industries use IP and intangible assets for business growth. To learn how you can leverage on your IP, book a complimentary chat session on your intangible assets with us today.\"</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">&nbsp;</p>\n');
INSERT INTO `object_localized_data_4` VALUES (46, 'zh', NULL, NULL, NULL);
INSERT INTO `object_localized_data_4` VALUES (48, 'en', 'Speco Singapore Pte Ltd', 'Ye Thu Aung (IP Strategist)', '<p style=\"margin-left:0; margin-right:0; text-align:start\">Speco Singapore Pte Ltd Recognising that its latest innovation was essential in the COVID-19 pandemic and beyond, homegrown cleaning solutions company Speco Singapore Pte Ltd worked with IPOS International to uncover its intangible assets and safeguard its competitive edge.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Key Outcomes</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Identified all critical IP and broader IA owned or controlled, and uncovered their value in maintaining a competitive edge.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Diagnosed gaps and mitigated risks in existing IA portfolio that undermined their business model.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Recommended licensing models and enhanced trade mark strategy to protect new innovations and maximise profits from IP commercialisation.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Devised new product brand and holistic protection strategy to strengthen overall IA portfolio and safeguard long-term growth and revenue.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The Innovation</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Founded in 2017 as a humble housekeeping service, this Singaporean enterprise was borne from its founder’s desire to help disadvantaged workers secure employment in the housekeeping sector. It has since evolved into a full-fledged cleaning solutions company, partnering over 60 social service agencies to provide stable employment opportunities for marginalised groups such as ex-offenders, persons with disabilities, victims of abuse, and the homeless. Its latest innovation is a proprietary cleaning agent that is effective against bacteria and viruses for up to 6 months per application, including against coronaviruses.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The Challenge</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The absence of a contractual relationship between the client and the external parties whom it funded to invent and manufacture its core product meant that the client’s business model was highly vulnerable to copying and risks of loss. Proving IP ownership was also a challenge that hindered the client’s plans for securing investor funding and business expansion.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">The Solution</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">IP Strategists at IPOS International and EverEdge jointly devised a comprehensive strategy to secure all IP rights critical to the client’s business, including providing advisory on negotiation for key commercial terms in their licensing agreement with the inventor of the cleaning agent. To differentiate this new product from its competitors, recommendations on its trade mark strategy were also provided, along with key considerations for devising a new product brand.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Results</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Having gained a comprehensive overview of the IA portfolio it owns and controls, the client not only recognised how each one critically impacts its business model, but was empowered to leverage them to drive enterprise growth. Early identification of risks associated with each IA were also significantly mitigated through the plans proposed. In adopting the recommended IA strategy and frameworks, the client successfully obtained a Provisional Patent for its core product – a commitment that distinguished them from their competitors and boosted their credibility among consumers. The recommended actions also enabled the client to further secure strategic accounts to fuel its long-term growth and sustainability.\"</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">To get more in-depth content and actionable tips on using business strategies to derive income from your IP rights, subscribe to our IP management business guide —&nbsp;<span style=\"color:#e34a21; font-family:Poppins,sans-serif\">Building A Strong Brand.</span>.</p>\n');
INSERT INTO `object_localized_data_4` VALUES (48, 'zh', NULL, NULL, NULL);
INSERT INTO `object_localized_data_4` VALUES (50, 'en', 'Cloud Security', 'IPOS International', '<p style=\"margin-left:0; margin-right:0; text-align:start\">These were some of the biggest names that have fallen victims to cloud-related security breaches in recent years.1.2 As more organisations join the ever-growing list of victims, many of such cyber threats are on-going and may remain undetected. For industries which are keen adopters of cloud technology, incidents of security breaches can be costly. Monetary loss aside, concerns over the organisation\'s reputation and consumer confidence are some of the aftermath issues that organisations will urgently need to address</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Nevertheless, the adoption of cloud-based solutions by organisations will only increase in the current digitisation-powered Industry 4.0 era. Driven by financial and espionage motives, the cloud, with its increasing mass of confidential data, thus represents an attractive target for hackers, who constantly modify their modes of attack to steal invaluable information.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Hence, threats to cloud platforms demand attention from both service providers and consumers of cloud technology. Solutions to tackle these threats are a major consideration for further applications of cloud technologies. Consequently, innovators are actively confronting these challenges head-on by pursuing new innovations to thwart the work of hackers and attackers. Given the pertinent need to understand innovative methods to ensure cloud safety, this report looks at worldwide patent applications relating to cloud security published in 2009-2018 with a particular focus on the areas of identity and access management; data security; network security; virtualisation security; and security policy management, to understand the current technologies in cloud security.</p>\n');
INSERT INTO `object_localized_data_4` VALUES (50, 'zh', NULL, NULL, NULL);
INSERT INTO `object_localized_data_4` VALUES (52, 'en', 'IP Expert Series Bootcamp – Leveraging Your Intangible Assets for Global Success', ' Ye Thu Aung,IP Strategist', '<p style=\"margin-left:0; margin-right:0; text-align:start\">Building strategies around a business idea, product or service is something all entrepreneurs and business owners are good at. Knowing how to fit intellectual property (IP) and intangible assets (IA) into these strategies to grow may not come as easily. How does one build a strong growth strategy with IP and IA? Why does it matter?</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Get your answers with this IP Expert Series - Achieving MAD Growth with Intangible Assets webinar where Senior IP Strategist, Fu Zhikang shares:</p>\n\n<div class=\"list-style-general margin\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">\n<ol>\n	<li>Why intangible assets are valuable to businesses.</li>\n	<li>How to Identify key intangible assets with the M.A.D. Growth framework in 30 mins.</li>\n	<li>How to increase business impact with good intangible assets management.</li>\n</ol>\n</div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">This webinar is held in association with&nbsp;IP Week @ SG 2021.</p>\n');
INSERT INTO `object_localized_data_4` VALUES (52, 'zh', NULL, NULL, NULL);
