INSERT INTO `object_localized_data_4` VALUES (79, 'en', 'IP Expert Series Bootcamp – Leveraging Your Intangible Assets for Global Success', ' Ye Thu Aung,IP Strategist', '<p style=\"margin-left:0; margin-right:0; text-align:start\">Building strategies around a business idea, product or service is something all entrepreneurs and business owners are good at. Knowing how to fit intellectual property (IP) and intangible assets (IA) into these strategies to grow may not come as easily. How does one build a strong growth strategy with IP and IA? Why does it matter?</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Get your answers with this IP Expert Series - Achieving MAD Growth with Intangible Assets webinar where Senior IP Strategist, Fu Zhikang shares:</p>\n\n<div class=\"list-style-general margin\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">\n<ol>\n	<li>Why intangible assets are valuable to businesses.</li>\n	<li>How to Identify key intangible assets with the M.A.D. Growth framework in 30 mins.</li>\n	<li>How to increase business impact with good intangible assets management.</li>\n</ol>\n</div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">This webinar is held in association with&nbsp;IP Week @ SG 2021.</p>\n');
