INSERT INTO `object_localized_query_4_en` VALUES (79, 'en', 'IP Expert Series Bootcamp – Leveraging Your Intangible Assets for Global Success', ' Ye Thu Aung,IP Strategist', 'Building strategies around a business idea, product or service is something all entrepreneurs and business owners are good at. Knowing how to fit intellectual property (IP) and intangible assets (IA) into these strategies to grow may not come as easily. How does one build a strong growth strategy with IP and IA? Why does it matter? Get your answers with this IP Expert Series - Achieving MAD Growth with Intangible Assets webinar where Senior IP Strategist, Fu Zhikang shares: Why intangible assets are valuable to businesses. How to Identify key intangible assets with the M.A.D. Growth framework in 30 mins. How to increase business impact with good intangible assets management. This webinar is held in association with&nbsp;IP Week @ SG 2021. ');
INSERT INTO `object_localized_query_4_en` VALUES (80, 'en', 'IP Expert Series Bootcamp – Leveraging Your Intangible Assets for Global Success', ' Ye Thu Aung,IP Strategist', 'Building strategies around a business idea, product or service is something all entrepreneurs and business owners are good at. Knowing how to fit intellectual property (IP) and intangible assets (IA) into these strategies to grow may not come as easily. How does one build a strong growth strategy with IP and IA? Why does it matter? Get your answers with this IP Expert Series - Achieving MAD Growth with Intangible Assets webinar where Senior IP Strategist, Fu Zhikang shares: Why intangible assets are valuable to businesses. How to Identify key intangible assets with the M.A.D. Growth framework in 30 mins. How to increase business impact with good intangible assets management. This webinar is held in association with&nbsp;IP Week @ SG 2021. ');
