INSERT INTO `object_query_1` VALUES (61, '1', 'Course', 'Seminar', 'Beginner', 'Bussiness', 'IP Professionals', 'Stay current on the latest IP law developments in Singapore and the UK with this flagship programme for IP professionals. Where relevant, developments in the EU, US, and Australia are also discussed in this series, which typically runs in the first quarter of the year. Get important updates on the four main domains of IP in four half-day sessions across January and February 2021: Copyright, Patents, Trade Marks / Passing Off and Breach of Confidence / Privacy and Data Protection. Like its previous sell-out editions, this 8th edition returns with a line-up of prestigious speakers, comprising distinguished academics, experienced practitioners, industry representatives, and representatives from the public sector. Anyone with an interest in IP will benefit greatly from this programme. PARTNER ORGANISATIONS <img alt=\"\" src=\"https://iposintl-fe.fixxstaging.com/assets/images/part1.8dd7d8d.png\" style=\"border-style:none; box-sizing:border-box; outline:none; vertical-align:middle\" /> <img alt=\"\" src=\"https://iposintl-fe.fixxstaging.com/assets/images/part2.2d1c044.png\" style=\"border-style:none; box-sizing:border-box; outline:none; vertical-align:middle\" /> <img alt=\"\" src=\"https://iposintl-fe.fixxstaging.com/assets/images/part3.fe89e4c.png\" style=\"border-style:none; box-sizing:border-box; outline:none; vertical-align:middle\" /> ', NULL, NULL, 'Due to the current COVID-19 situation, all courses will be conducted via online streaming. We will be providing participants with the relevant materials prior to the course. When the COVID-19 situation improves in the near future and this course is able to be conducted face-to-face, we will update course registrants accordingly.', NULL, NULL);
