INSERT INTO `object_query_3` VALUES (42, '3', 'Faqs', 'What are intangible assets?', 'Copyright Copyright protects the expression of ideas in the form of literary or artistic works, such as novels, videos, music, photographs, and other media works. It also applies to computer software. While copyright covers all content produced by a company, only certain assets may be of significant value on their own. Registered Design Registered designs protect the aesthetic look of an article or non-physical product, like its shape, pattern, or configuration. Patent Patents protect the functional elements of a technology or “how it works”. A patent should provide a technical solution, and an aspect of the solution must be novel, inventive and non-obvious. Brand Brand refers to the way businesses’ products and services are experienced by consumers, along with market and customer opinions of the company. Having a brand helps to maintain a company’s distinction in the marketplace even if a competitor is offering a similar product. Additionally, different forms of protection over a brand are by themselves also IA, which include registered and unregistered trade marks, and domain names. Registered Trade Mark Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace. Unregistered Trade Mark Unregistered trade marks refer to a brand’s reputation, awareness among consumers, and offerings. Unlike registered trade marks, these rights arise from “use”, and is not registered. Domain Name Internet addresses which contribute to online branding may be protected. Domain names provide another consumer touchpoint, which enhances overall brand presence. Data Valuable data is either unique in origin or history, provides important insight, or has an associated value proposition.&nbsp;Read also: Safeguarding Your Competitive Edge This can range from client databases, estimated market size, actual number of products or services purchased, to milestone numbers that can predict trends.&nbsp;Read also: From Pulling Data to Pushing Borders Trade Secrets / Know-how Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace. ', 'Intellectual Property and Intangible Assets');
INSERT INTO `object_query_3` VALUES (43, '3', 'Faqs', 'What is the difference between intangible assets and intellectual property?', 'Copyright Copyright protects the expression of ideas in the form of literary or artistic works, such as novels, videos, music, photographs, and other media works. It also applies to computer software. While copyright covers all content produced by a company, only certain assets may be of significant value on their own. Registered Design Registered designs protect the aesthetic look of an article or non-physical product, like its shape, pattern, or configuration. Patent Patents protect the functional elements of a technology or “how it works”. A patent should provide a technical solution, and an aspect of the solution must be novel, inventive and non-obvious. Brand Brand refers to the way businesses’ products and services are experienced by consumers, along with market and customer opinions of the company. Having a brand helps to maintain a company’s distinction in the marketplace even if a competitor is offering a similar product. Additionally, different forms of protection over a brand are by themselves also IA, which include registered and unregistered trade marks, and domain names. Registered Trade Mark Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace. Unregistered Trade Mark Unregistered trade marks refer to a brand’s reputation, awareness among consumers, and offerings. Unlike registered trade marks, these rights arise from “use”, and is not registered. Domain Name Internet addresses which contribute to online branding may be protected. Domain names provide another consumer touchpoint, which enhances overall brand presence. Data Valuable data is either unique in origin or history, provides important insight, or has an associated value proposition.&nbsp;Read also: Safeguarding Your Competitive Edge This can range from client databases, estimated market size, actual number of products or services purchased, to milestone numbers that can predict trends.&nbsp;Read also: From Pulling Data to Pushing Borders Trade Secrets / Know-how Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace. ', 'Discover Intangible Assets');
