INSERT INTO `object_store_1` VALUES (61, 'Seminar', 'Beginner', 'Bussiness', 'IP Professionals', '<p style=\"margin-left:0; margin-right:0; text-align:start\">Stay current on the latest IP law developments in Singapore and the UK with this flagship programme for IP professionals. Where relevant, developments in the EU, US, and Australia are also discussed in this series, which typically runs in the first quarter of the year.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Get important updates on the four main domains of IP in four half-day sessions across January and February 2021: Copyright, Patents, Trade Marks / Passing Off and Breach of Confidence / Privacy and Data Protection.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:start\">Like its previous sell-out editions, this 8th edition returns with a line-up of prestigious speakers, comprising distinguished academics, experienced practitioners, industry representatives, and representatives from the public sector. Anyone with an interest in IP will benefit greatly from this programme.</p>\n\n<div class=\"m-t-40 partner\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; margin-top:40px !important; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">\n<div class=\"partner_title\" style=\"box-sizing:border-box; color:#515b61; font-family:Poppins,sans-serif; font-size:10px; font-style:normal; font-weight:400; letter-spacing:0.12em; line-height:14px; outline:none; text-transform:uppercase\">PARTNER ORGANISATIONS</div>\n\n<div class=\"partner_content\" style=\"box-sizing:border-box; display:flex; flex-wrap:wrap; font-family:Poppins,sans-serif; font-weight:400; outline:none\">\n<div class=\"partner_content_item\" style=\"box-sizing:border-box; font-family:Poppins,sans-serif; font-weight:400; margin-right:30px; outline:none\"><img alt=\"\" src=\"https://iposintl-fe.fixxstaging.com/assets/images/part1.8dd7d8d.png\" style=\"border-style:none; box-sizing:border-box; outline:none; vertical-align:middle\" /></div>\n\n<div class=\"partner_content_item\" style=\"box-sizing:border-box; font-family:Poppins,sans-serif; font-weight:400; margin-right:30px; outline:none\"><img alt=\"\" src=\"https://iposintl-fe.fixxstaging.com/assets/images/part2.2d1c044.png\" style=\"border-style:none; box-sizing:border-box; outline:none; vertical-align:middle\" /></div>\n\n<div class=\"partner_content_item\" style=\"box-sizing:border-box; font-family:Poppins,sans-serif; font-weight:400; margin-right:0px; outline:none\"><img alt=\"\" src=\"https://iposintl-fe.fixxstaging.com/assets/images/part3.fe89e4c.png\" style=\"border-style:none; box-sizing:border-box; outline:none; vertical-align:middle\" /></div>\n</div>\n</div>\n', NULL, NULL, 'Due to the current COVID-19 situation, all courses will be conducted via online streaming. We will be providing participants with the relevant materials prior to the course. When the COVID-19 situation improves in the near future and this course is able to be conducted face-to-face, we will update course registrants accordingly.', 'a:4:{i:0;a:2:{s:5:\"title\";a:3:{s:4:\"name\";s:5:\"title\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:9:\"1 Session\";}s:9:\"feeDetail\";a:3:{s:4:\"name\";s:9:\"feeDetail\";s:4:\"type\";s:7:\"wysiwyg\";s:4:\"data\";s:131:\"<ul style=\"margin-left:0; margin-right:0\">\n	<li><s>$267.50</s>&nbsp;$214.00 (20% off)</li>\n	<li>Prices inclusive of GST</li>\n</ul>\n\";}}i:1;a:2:{s:5:\"title\";a:3:{s:4:\"name\";s:5:\"title\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:10:\"2 Sessions\";}s:9:\"feeDetail\";a:3:{s:4:\"name\";s:9:\"feeDetail\";s:4:\"type\";s:7:\"wysiwyg\";s:4:\"data\";s:131:\"<ul style=\"margin-left:0; margin-right:0\">\n	<li><s>$535.00</s>&nbsp;$428.00 (20% off)</li>\n	<li>Prices inclusive of GST</li>\n</ul>\n\";}}i:2;a:2:{s:5:\"title\";a:3:{s:4:\"name\";s:5:\"title\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:10:\"3 Sessions\";}s:9:\"feeDetail\";a:3:{s:4:\"name\";s:9:\"feeDetail\";s:4:\"type\";s:7:\"wysiwyg\";s:4:\"data\";s:131:\"<ul style=\"margin-left:0; margin-right:0\">\n	<li><s>$802.50</s>&nbsp;$642.00 (20% off)</li>\n	<li>Prices inclusive of GST</li>\n</ul>\n\";}}i:3;a:2:{s:5:\"title\";a:3:{s:4:\"name\";s:5:\"title\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:10:\"4 Sessions\";}s:9:\"feeDetail\";a:3:{s:4:\"name\";s:9:\"feeDetail\";s:4:\"type\";s:7:\"wysiwyg\";s:4:\"data\";s:132:\"<ul style=\"margin-left:0; margin-right:0\">\n	<li><s>$1070.00</s>&nbsp;$856.00 (20% off)</li>\n	<li>Prices inclusive of GST</li>\n</ul>\n\";}}}', 'a:0:{}', 'a:2:{i:0;a:3:{s:11:\"contactName\";a:3:{s:4:\"name\";s:11:\"contactName\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:14:\"Ms Pearlyn Yap\";}s:13:\"contactMobile\";a:3:{s:4:\"name\";s:13:\"contactMobile\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:13:\"+65 6331 6567\";}s:12:\"contactEmail\";a:3:{s:4:\"name\";s:12:\"contactEmail\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:33:\"pearlyn.yap@iposinternational.com\";}}i:1;a:3:{s:11:\"contactName\";a:3:{s:4:\"name\";s:11:\"contactName\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:16:\"Ms Dilpreet Kaur\";}s:13:\"contactMobile\";a:3:{s:4:\"name\";s:13:\"contactMobile\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:13:\"+65 6330 8692\";}s:12:\"contactEmail\";a:3:{s:4:\"name\";s:12:\"contactEmail\";s:4:\"type\";s:5:\"input\";s:4:\"data\";s:35:\"dilpreet.kaur@iposinternational.com\";}}}', NULL, NULL);
