INSERT INTO `object_store_3` VALUES (42, 'What are intangible assets?', '<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Copyright</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Copyright protects the expression of ideas in the form of literary or artistic works, such as novels, videos, music, photographs, and other media works. It also applies to computer software. While copyright covers all content produced by a company, only certain assets may be of significant value on their own.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered Design</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered designs protect the aesthetic look of an article or non-physical product, like its shape, pattern, or configuration.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Patent</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Patents protect the functional elements of a technology or “how it works”. A patent should provide a technical solution, and an aspect of the solution must be novel, inventive and non-obvious.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Brand</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Brand refers to the way businesses’ products and services are experienced by consumers, along with market and customer opinions of the company. Having a brand helps to maintain a company’s distinction in the marketplace even if a competitor is offering a similar product. Additionally, different forms of protection over a brand are by themselves also IA, which include registered and unregistered trade marks, and domain names.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered Trade Mark</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Unregistered Trade Mark</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Unregistered trade marks refer to a brand’s reputation, awareness among consumers, and offerings. Unlike registered trade marks, these rights arise from “use”, and is not registered.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Domain Name</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Internet addresses which contribute to online branding may be protected. Domain names provide another consumer touchpoint, which enhances overall brand presence.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Data</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Valuable data is either unique in origin or history, provides important insight, or has an associated value proposition.&nbsp;<span style=\"color:#e34a21; font-family:Poppins,sans-serif\">Read also: Safeguarding Your Competitive Edge</span></div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">This can range from client databases, estimated market size, actual number of products or services purchased, to milestone numbers that can predict trends.&nbsp;<span style=\"color:#e34a21; font-family:Poppins,sans-serif\">Read also: From Pulling Data to Pushing Borders</span></div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Trade Secrets / Know-how</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace.</div>\n', 'Intellectual Property and Intangible Assets');
INSERT INTO `object_store_3` VALUES (43, 'What is the difference between intangible assets and intellectual property?', '<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Copyright</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Copyright protects the expression of ideas in the form of literary or artistic works, such as novels, videos, music, photographs, and other media works. It also applies to computer software. While copyright covers all content produced by a company, only certain assets may be of significant value on their own.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered Design</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered designs protect the aesthetic look of an article or non-physical product, like its shape, pattern, or configuration.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Patent</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Patents protect the functional elements of a technology or “how it works”. A patent should provide a technical solution, and an aspect of the solution must be novel, inventive and non-obvious.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Brand</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Brand refers to the way businesses’ products and services are experienced by consumers, along with market and customer opinions of the company. Having a brand helps to maintain a company’s distinction in the marketplace even if a competitor is offering a similar product. Additionally, different forms of protection over a brand are by themselves also IA, which include registered and unregistered trade marks, and domain names.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered Trade Mark</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Unregistered Trade Mark</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Unregistered trade marks refer to a brand’s reputation, awareness among consumers, and offerings. Unlike registered trade marks, these rights arise from “use”, and is not registered.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Domain Name</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Internet addresses which contribute to online branding may be protected. Domain names provide another consumer touchpoint, which enhances overall brand presence.</div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Data</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Valuable data is either unique in origin or history, provides important insight, or has an associated value proposition.&nbsp;<span style=\"color:#e34a21; font-family:Poppins,sans-serif\">Read also: Safeguarding Your Competitive Edge</span></div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">This can range from client databases, estimated market size, actual number of products or services purchased, to milestone numbers that can predict trends.&nbsp;<span style=\"color:#e34a21; font-family:Poppins,sans-serif\">Read also: From Pulling Data to Pushing Borders</span></div>\n\n<div class=\"content-part-title\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000; font-family:Rubik; font-size:24px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:300; letter-spacing:normal; line-height:31px; margin-bottom:12px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Trade Secrets / Know-how</div>\n\n<div class=\"content-part-txt\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#333333; font-family:Poppins; font-size:18px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; line-height:27px; margin-bottom:30px; orphans:2; outline:none; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">Registered trade marks provide a formal registration to protect the brand from confusingly similar brands in the marketplace.</div>\n', 'Discover Intangible Assets');
