INSERT INTO `object_store_6` VALUES (74, 'Fu Zhikang', 'Mark is a Director and Chief Legal Counsel at IPOS (the Intellectual Property Office of Singapore), where he heads the Hearings & Mediation Department.\n\n\nHe has more than 25 years of experience in intellectual property law. Prior to joining IPOS in 2010, Mark was a lawyer in private practice for 15 years. His work encompasses all areas of intellectual property (“IP”) law. He also has experience in international arbitration proceedings.\n\n\nMark is regularly consulted on IP matters by various government agencies and invited to speak at both national and international IP conferences.\n\n\nAt IPOS International/ IP Academy (a wholly-owned subsidiary of IPOS), Mark oversees the development and curation of training programmes in the area of IP law for the legal community and IP professionals, as well as the public sector in Singapore.\n\n\nMark has published many articles in both local and international law journals. He is a co-author of the chapter on Copyright in Halsbury\'s Laws of Singapore: Volume 13(3) - Intellectual property (2007 & 2018 Reissue, Lexis-Nexis, Singapore).\n\n\nMark is an Adjunct Professor at the National University of Singapore Faculty of Law. He currently co-teaches the module on Foundations of IP Law, where he covers the section on patents. He is also currently the Subject Coordinator for the IP Module for the Singapore Institute of Legal Education’s course for trainee lawyers.', 'IP Strategists', NULL, 'IP Strategist, Project Lead');
INSERT INTO `object_store_6` VALUES (75, 'Low Jin Wei', 'Mark is a Director and Chief Legal Counsel at IPOS (the Intellectual Property Office of Singapore), where he heads the Hearings & Mediation Department.\n\n\nHe has more than 25 years of experience in intellectual property law. Prior to joining IPOS in 2010, Mark was a lawyer in private practice for 15 years. His work encompasses all areas of intellectual property (“IP”) law. He also has experience in international arbitration proceedings.\n\n\nMark is regularly consulted on IP matters by various government agencies and invited to speak at both national and international IP conferences.\n\n\nAt IPOS International/ IP Academy (a wholly-owned subsidiary of IPOS), Mark oversees the development and curation of training programmes in the area of IP law for the legal community and IP professionals, as well as the public sector in Singapore.\n\n\nMark has published many articles in both local and international law journals. He is a co-author of the chapter on Copyright in Halsbury\'s Laws of Singapore: Volume 13(3) - Intellectual property (2007 & 2018 Reissue, Lexis-Nexis, Singapore).\n\n\nMark is an Adjunct Professor at the National University of Singapore Faculty of Law. He currently co-teaches the module on Foundations of IP Law, where he covers the section on patents. He is also currently the Subject Coordinator for the IP Module for the Singapore Institute of Legal Education’s course for trainee lawyers.', 'IP Strategists', NULL, 'IP Strategist, Client Lead');
