INSERT INTO `tmp_store` VALUES ('document_session_38_utod78bdvjml49t5689uodu2h0', 'document-session', 'O:27:\"Pimcore\\Model\\Document\\Page\":33:{s:8:\"\0*\0title\";s:8:\"Overview\";s:14:\"\0*\0description\";s:0:\"\";s:11:\"\0*\0metaData\";a:0:{}s:7:\"\0*\0type\";s:4:\"page\";s:12:\"\0*\0prettyUrl\";N;s:17:\"\0*\0targetGroupIds\";s:0:\"\";s:13:\"\0*\0controller\";s:48:\"App\\Controller\\AcademyController::overviewAction\";s:11:\"\0*\0template\";N;s:12:\"\0*\0editables\";a:16:{s:19:\"academy_about_title\";O:37:\"Pimcore\\Model\\Document\\Editable\\Input\":6:{s:7:\"\0*\0text\";s:273:\"IP Academy is the education and training arm of IPOS International, and Singapore’s only dedicated centre for intellectual property education and training. We help enterprises and industries leverage their intellectual property (IP) and intangible assets (IA) for growth.\";s:7:\"\0*\0name\";s:19:\"academy_about_title\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:38;s:12:\"\0*\0inherited\";b:0;s:14:\"\0*\0inDialogBox\";N;}s:19:\"academy_about_text1\";O:37:\"Pimcore\\Model\\Document\\Editable\\Input\":6:{s:7:\"\0*\0text\";s:379:\"Founded in 2003, IP Academy has established itself as a center of excellence in IP/IA education and training in Singapore and the region. Showcasing a multilingual faculty from both academia and industry, our range of executive training and certification programmes aim to build skills and expertise in the fields of intellectual property law, IP/IA management and value creation\";s:7:\"\0*\0name\";s:19:\"academy_about_text1\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:38;s:12:\"\0*\0inherited\";b:0;s:14:\"\0*\0inDialogBox\";N;}s:19:\"academy_about_text2\";O:37:\"Pimcore\\Model\\Document\\Editable\\Input\":6:{s:7:\"\0*\0text\";s:528:\"IP Academy has also built a global network of partnerships with institutes of higher learning and professional associations to augment our programmes, seminars and roundtables.  Our students and institutional clients are from all over the world, facilitating the sharing of best practices and knowledge. Whether you are a business or public agency looking to build capabilities in IP/IA management, or an individual seeking a career in this exciting area of IP/IA, we have will have a suitable programme for your specific needs.\";s:7:\"\0*\0name\";s:19:\"academy_about_text2\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:38;s:12:\"\0*\0inherited\";b:0;s:14:\"\0*\0inDialogBox\";N;}s:16:\"background-image\";O:37:\"Pimcore\\Model\\Document\\Editable\\Image\":14:{s:5:\"\0*\0id\";i:162;s:6:\"\0*\0alt\";s:0:\"\";s:14:\"\0*\0cropPercent\";N;s:12:\"\0*\0cropWidth\";N;s:13:\"\0*\0cropHeight\";N;s:10:\"\0*\0cropTop\";N;s:11:\"\0*\0cropLeft\";N;s:11:\"\0*\0hotspots\";a:0:{}s:9:\"\0*\0marker\";a:0:{}s:7:\"\0*\0name\";s:16:\"background-image\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:38;s:12:\"\0*\0inherited\";b:0;s:14:\"\0*\0inDialogBox\";N;}s:40:\"our_partners_images:1.our_partners_image\";O:37:\"Pimcore\\Model\\Document\\Editable\\Image\":14:{s:5:\"\0*\0id\";i:166;s:6:\"\0*\0alt\";s:0:\"\";s:14:\"\0*\0cropPercent\";N;s:12:\"\0*\0cropWidth\";N;s:13:\"\0*\0cropHeight\";N;s:10:\"\0*\0cropTop\";N;s:11:\"\0*\0cropLeft\";N;s:11:\"\0*\0hotspots\";N;s:9:\"\0*\0marker\";N;s:7:\"\0*\0name\";s:40:\"our_partners_images:1.our_partners_image\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:38;s:12:\"\0*\0inherited\";b:0;s:14:\"\0*\0inDialogBox\";N;}s:19:\"our_partners_images\";O:37:\"Pimcore\\Model\\Document\\Editable\\Block\":7:{s:10:\"\0*\0indices\";a:10:{i:0;s:1:\"1\";i:1;s:1:\"2\";i:2;s:1:\"3\";i:3;s:1:\"4\";i:4;s:1:\"5\";i:5;s:1:\"6\";i:6;s:1:\"7\";i:7;s:1:\"8\";i:8;s:1:\"9\";i:9;s:2:\"10\";}s:10:\"\0*\0current\";i:0;s:7:\"\0*\0name\";s:19:\"our_partners_images\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:38;s:12:\"\0*\0inherited\";b:0;s:14:\"\0*\0inDialogBox\";N;}s:8:\"tnc_wrap\";O:37:\"Pimcore\\Model\\Document\\Editable\\Block\":7:{s:10:\"\0*\0indices\";a:0:{}s:10:\"\0*